script: |
  super -f text -I q3855.spq | sort > q3855.out

inputs:
  - name: q3855.spq
    data: |
      SELECT DISTINCT + col1 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT col2 BETWEEN - 95 / col2 + + col2 AND - col0;
  - name: tab0

outputs:
  - name: q3855.out
    data: |
      1
      21
      81
